from collections import deque
import random

class Actor:
    def __init__(self, name, input_size, output_size, size_layer):
        with tf.variable_scope(name):
            # 입력 데이터를 받을 placeholder를 생성합니다.
            self.X = tf.placeholder(tf.float32, (None, None, input_size))
            # 이전 hidden state를 받을 placeholder를 생성합니다.
            self.hidden_layer = tf.placeholder(tf.float32, (None, 2 * size_layer))
            # LSTM 셀을 생성합니다.
            cell = tf.nn.rnn_cell.LSTMCell(size_layer, state_is_tuple=False)
            # dynamic_rnn 함수를 통해 RNN을 생성합니다.
            # rnn은 모든 타임 스텝의 출력을 반환하고, last_state는 마지막 hidden state를 반환합니다.
            self.rnn, self.last_state = tf.nn.dynamic_rnn(inputs=self.X, cell=cell,
                                                          dtype=tf.float32,
                                                          initial_state=self.hidden_layer)
            # 마지막 타임 스텝의 출력을 통해 output layer를 생성합니다.
            self.logits = tf.layers.dense(self.rnn[:, -1], output_size)


class Critic:
    def __init__(self, name, input_size, output_size, size_layer, learning_rate):
        with tf.variable_scope(name):
            # 입력 데이터를 받을 placeholder를 생성합니다.
            self.X = tf.placeholder(tf.float32, (None, None, input_size))
            # 정답 데이터를 받을 placeholder를 생성합니다.
            self.Y = tf.placeholder(tf.float32, (None, output_size))
            # 이전 hidden state를 받을 placeholder를 생성합니다.
            self.hidden_layer = tf.placeholder(tf.float32, (None, 2 * size_layer))
            # 보상 값을 받을 placeholder를 생성합니다.
            self.REWARD = tf.placeholder(tf.float32, (None, 1))
            # 입력 데이터를 통해 은닉층을 생성합니다.
            feed_critic = tf.layers.dense(self.X, size_layer, activation=tf.nn.relu)
            # LSTM 셀을 생성합니다.
            cell = tf.nn.rnn_cell.LSTMCell(size_layer, state_is_tuple=False)
            # dynamic_rnn 함수를 통해 RNN을 생성합니다.
            # rnn은 모든 타임 스텝의 출력을 반환하고, last_state는 마지막 hidden state를 반환합니다.
            self.rnn, self.last_state = tf.nn.dynamic_rnn(inputs=self.X, cell=cell,
                                                          dtype=tf.float32,
                                                          initial_state=self.hidden_layer)
            # 마지막 타임 스텝의 출력을 통해 은닉층을 생성합니다.
            feed_critic = tf.layers.dense(self.rnn[:, -1], output_size, activation=tf.nn.relu) + self.Y
            feed_critic = tf.layers.dense(feed_critic, size_layer // 2, activation=tf.nn.relu)
            # 출력층을 생성합니다.
            self.logits = tf.layers.dense(feed_critic, 1)
            # 비용 함수를 정의합니다.
            self.cost = tf.reduce_mean(tf.square(self.REWARD - self.logits))
            # 옵티마이저를 정의하고 비용을 최소화합니다.
            self.optimizer = tf.train.AdamOptimizer(learning_rate).minimize(self.cost)


class Agent:

    LEARNING_RATE = 0.001  # 학습률
    BATCH_SIZE = 32  # 배치 크기
    LAYER_SIZE = 256  # 은닉층 크기
    OUTPUT_SIZE = 3  # 출력 크기
    EPSILON = 0.5  # 엡실론 값 (탐험과 활용 간 균형을 조절하는 파라미터)
    DECAY_RATE = 0.005  # 엡실론 감쇠율
    MIN_EPSILON = 0.1  # 최소 엡실론 값
    GAMMA = 0.99  # 할인 계수
    MEMORIES = deque()  # 경험 메모리 (deque를 사용하여 FIFO 구조의 메모리)
    MEMORY_SIZE = 300  # 경험 메모리 크기 제한
    COPY = 1000  # 신경망 가중치 복사 간격
    T_COPY = 0  # 가중치 복사 횟수 초기화

    def __init__(self, state_size, window_size, trend, skip):
        self.state_size = state_size
        self.window_size = window_size
        self.half_window = window_size // 2
        self.trend = trend
        self.skip = skip
        tf.reset_default_graph()

        # Actor 및 Critic 신경망 초기화
        self.actor = Actor('actor-original', self.state_size, self.OUTPUT_SIZE, self.LAYER_SIZE)
        self.actor_target = Actor('actor-target', self.state_size, self.OUTPUT_SIZE, self.LAYER_SIZE)
        self.critic = Critic('critic-original', self.state_size, self.OUTPUT_SIZE, self.LAYER_SIZE, self.LEARNING_RATE)
        self.critic_target = Critic('critic-target', self.state_size, self.OUTPUT_SIZE, self.LAYER_SIZE, self.LEARNING_RATE)

        # Critic의 그라디언트 및 Actor-Critic 그라디언트 플레이스홀더 초기화
        self.grad_critic = tf.gradients(self.critic.logits, self.critic.Y)
        self.actor_critic_grad = tf.placeholder(tf.float32, [None, self.OUTPUT_SIZE])

        # Actor의 그라디언트 계산 및 옵티마이저 초기화
        weights_actor = tf.get_collection(tf.GraphKeys.TRAINABLE_VARIABLES, scope='actor')
        self.grad_actor = tf.gradients(self.actor.logits, weights_actor, -self.actor_critic_grad)
        grads = zip(self.grad_actor, weights_actor)
        self.optimizer = tf.train.AdamOptimizer(self.LEARNING_RATE).apply_gradients(grads)

        # TensorFlow 세션 초기화
        self.sess = tf.InteractiveSession()
        self.sess.run(tf.global_variables_initializer())

    def _assign(self, from_name, to_name):
        from_w = tf.get_collection(tf.GraphKeys.TRAINABLE_VARIABLES, scope=from_name)
        to_w = tf.get_collection(tf.GraphKeys.TRAINABLE_VARIABLES, scope=to_name)
        for i in range(len(from_w)):
            assign_op = to_w[i].assign(from_w[i])
            self.sess.run(assign_op)

    def _memorize(self, state, action, reward, new_state, dead):
        self.MEMORIES.append((state, action, reward, new_state, dead))
        if len(self.MEMORIES) > self.MEMORY_SIZE:
            self.MEMORIES.popleft()

    def _select_action(self, state):
        if np.random.rand() < self.EPSILON:
            action = np.random.randint(self.OUTPUT_SIZE)
        else:
            prediction = self.sess.run(self.actor.logits, feed_dict={self.actor.X:[state]})[0]
            action = np.argmax(prediction)
        return action

    def _construct_memories_and_train(self, replay):
        # 추출된 경험에서 상태 및 새로운 상태를 가져와 배열로 변환
        states = np.array([a[0] for a in replay])
        new_states = np.array([a[3] for a in replay])

        # 현재 정책을 사용하여 현재 상태에 대한 행동 가치(Q값) 예측
        Q = self.sess.run(self.actor.logits, feed_dict={self.actor.X: states})
        # 타겟 정책을 사용하여 현재 상태에 대한 행동 가치(Q값) 예측
        Q_target = self.sess.run(self.actor_target.logits, feed_dict={self.actor_target.X: states})

        # 크리틱 네트워크의 그래디언트 계산
        grads = self.sess.run(self.grad_critic, feed_dict={self.critic.X: states, self.critic.Y: Q})[0]
        # 정책 네트워크 업데이트
        self.sess.run(self.optimizer, feed_dict={self.actor.X: states, self.actor_critic_grad: grads})

        # 에피소드의 보상과 타겟 정책의 행동 가치를 이용하여 리워드 업데이트
        rewards = np.array([a[2] for a in replay]).reshape((-1, 1))
        rewards_target = self.sess.run(self.critic_target.logits,
                                       feed_dict={self.critic_target.X:new_states,self.critic_target.Y:Q_target})
        for i in range(len(replay)):
            if not replay[0][-1]:
                rewards[i] += self.GAMMA * rewards_target[i]
        # 크리틱 네트워크 훈련
        cost, _ = self.sess.run([self.critic.cost, self.critic.optimizer],
                                feed_dict={self.critic.X:states, self.critic.Y:Q, self.critic.REWARD:rewards})
        return cost

    def get_state(self, t):
        # 현재 시간을 기준으로 상태를 반환하는 메서드
        # 상태는 주어진 시간의 윈도우 크기에 따라 생성됨
        window_size = self.window_size + 1
        d = t - window_size + 1
        block = self.trend[d : t + 1] if d >= 0 else -d * [self.trend[0]] + self.trend[0 : t + 1]
        res = []
        for i in range(window_size - 1):
            res.append(block[i + 1] - block[i])
        return np.array(res)

    def buy(self, initial_money):
          # 초기 자본 저장
          starting_money = initial_money
          # 매수 및 매도 상태를 저장할 리스트 초기화
          states_sell = []
          states_buy = []
          # 보유 중인 주식을 저장할 인벤토리 초기화
          inventory = []
          # 초기 상태 설정
          state = self.get_state(0)

          # 시간에 따라 반복
          for t in range(0, len(self.trend) - 1, self.skip):
              # 행동 선택
              action = self._select_action(state)
              # 다음 상태 계산
              next_state = self.get_state(t + 1)

              # 매수 조건 확인
              if action == 1 and initial_money >= self.trend[t]:
                  inventory.append(self.trend[t])
                  initial_money -= self.trend[t]
                  states_buy.append(t)
                  print('day %d: buy 1 unit at price %f, total balance %f'% (t, self.trend[t], initial_money))

              # 매도 조건 확인
              elif action == 2 and len(inventory):
                  bought_price = inventory.pop(0)
                  initial_money += self.trend[t]
                  states_sell.append(t)
                  try:
                      invest = ((close[t] - bought_price) / bought_price) * 100
                  except:
                      invest = 0
                  print(
                      'day %d, sell 1 unit at price %f, investment %f %%, total balance %f,'
#                       % (t, close[t], invest, initial_money)
                  )

              # 다음 상태로 업데이트
              state = next_state

          # 투자 수익률 계산
          invest = ((initial_money - starting_money) / starting_money) * 100
          # 총 이익 계산
          total_gains = initial_money - starting_money

          return states_buy, states_sell, total_gains, invest

    def train(self, iterations, checkpoint, initial_money):
        # 주어진 반복 횟수만큼 반복
        for i in range(iterations):
            # 총 이익 및 인벤토리 초기화
            total_profit = 0
            inventory = []
            # 초기 상태 설정
            state = self.get_state(0)
            # 초기 자본 저장
            starting_money = initial_money

            # 시간에 따라 반복
            for t in range(0, len(self.trend) - 1, self.skip):
                # 네트워크 복사 주기마다 가중치 복사
                if (self.T_COPY + 1) % self.COPY == 0:
                    self._assign('actor-original', 'actor-target')
                    self._assign('critic-original', 'critic-target')

                # 행동 선택
                action = self._select_action(state)
                # 다음 상태 계산
                next_state = self.get_state(t + 1)

                # 매수 조건 확인
                if action == 1 and starting_money >= self.trend[t]:
                    inventory.append(self.trend[t])
                    starting_money -= self.trend[t]

                # 매도 조건 확인
                elif action == 2 and len(inventory) > 0:
                    bought_price = inventory.pop(0)
                    total_profit += self.trend[t] - bought_price
                    starting_money += self.trend[t]

                # 투자 수익률 계산
                invest = ((starting_money - initial_money) / initial_money)

                # 메모리에 경험 저장
                self._memorize(state, action, invest, next_state, starting_money < initial_money)
                state = next_state
                # 미니배치 생성 및 훈련
                batch_size = min(len(self.MEMORIES), self.BATCH_SIZE)
                replay = random.sample(self.MEMORIES, batch_size)
                cost = self._construct_memories_and_train(replay)
                # 네트워크 복사 주기 및 엡실론 감소
                self.T_COPY += 1
                self.EPSILON = self.MIN_EPSILON + (1.0 - self.MIN_EPSILON) * np.exp(-self.DECAY_RATE * i)

            # 중간 결과 출력
            if (i+1) % checkpoint == 0:
                print('epoch: %d, total rewards: %f.3, cost: %f, total money: %f'%(i + 1, total_profit, cost,
                                                                                  starting_money))

# Commented out IPython magic to ensure Python compatibility.
from collections import deque
import random

class Actor:
    def __init__(self, name, input_size, output_size, size_layer):
        with tf.variable_scope(name):
            self.X = tf.placeholder(tf.float32, (None, input_size))
            feed_actor = tf.layers.dense(self.X, size_layer, activation = tf.nn.relu)
            self.logits = tf.layers.dense(feed_actor, output_size)

class Critic:
    def __init__(self, name, input_size, output_size, size_layer, learning_rate):
        with tf.variable_scope(name):
            self.X = tf.placeholder(tf.float32, (None, input_size))
            self.Y = tf.placeholder(tf.float32, (None, output_size))
            self.REWARD = tf.placeholder(tf.float32, (None, 1))
            feed_critic = tf.layers.dense(self.X, size_layer, activation = tf.nn.relu)
            feed_critic = tf.layers.dense(feed_critic, output_size, activation = tf.nn.relu) + self.Y
            feed_critic = tf.layers.dense(feed_critic, size_layer//2, activation = tf.nn.relu)
            self.logits = tf.layers.dense(feed_critic, 1)
            self.cost = tf.reduce_mean(tf.square(self.REWARD - self.logits))
            self.optimizer = tf.train.AdamOptimizer(learning_rate).minimize(self.cost)

class Agent:

    LEARNING_RATE = 0.0001
    BATCH_SIZE = 32
    LAYER_SIZE = 256
    OUTPUT_SIZE = 3
    EPSILON = 0.5
    DECAY_RATE = 0.005
    MIN_EPSILON = 0.1
    GAMMA = 0.99
    MEMORIES = deque()
    MEMORY_SIZE = 300
    COPY = 1000
    T_COPY = 0

    def __init__(self, state_size, window_size, trend, skip):
        self.state_size = state_size
        self.window_size = window_size
        self.half_window = window_size // 2
        self.trend = trend
        self.skip = skip
        tf.reset_default_graph()
        self.actor = Actor('actor-original', self.state_size, self.OUTPUT_SIZE, self.LAYER_SIZE)
        self.actor_target = Actor('actor-target', self.state_size, self.OUTPUT_SIZE, self.LAYER_SIZE)
        self.critic = Critic('critic-original', self.state_size, self.OUTPUT_SIZE, self.LAYER_SIZE, self.LEARNING_RATE)
        self.critic_target = Critic('critic-target', self.state_size, self.OUTPUT_SIZE,
                                    self.LAYER_SIZE, self.LEARNING_RATE)
        self.grad_critic = tf.gradients(self.critic.logits, self.critic.Y)
        self.actor_critic_grad = tf.placeholder(tf.float32, [None, self.OUTPUT_SIZE])
        weights_actor = tf.get_collection(tf.GraphKeys.TRAINABLE_VARIABLES, scope='actor')
        self.grad_actor = tf.gradients(self.actor.logits, weights_actor, -self.actor_critic_grad)
        grads = zip(self.grad_actor, weights_actor)
        self.optimizer = tf.train.AdamOptimizer(self.LEARNING_RATE).apply_gradients(grads)
        self.sess = tf.InteractiveSession()
        self.sess.run(tf.global_variables_initializer())

    def _assign(self, from_name, to_name):
        from_w = tf.get_collection(tf.GraphKeys.TRAINABLE_VARIABLES, scope=from_name)
        to_w = tf.get_collection(tf.GraphKeys.TRAINABLE_VARIABLES, scope=to_name)
        for i in range(len(from_w)):
            assign_op = to_w[i].assign(from_w[i])
            self.sess.run(assign_op)

    def _memorize(self, state, action, reward, new_state, dead):
        self.MEMORIES.append((state, action, reward, new_state, dead))
        if len(self.MEMORIES) > self.MEMORY_SIZE:
            self.MEMORIES.popleft()

    def _select_action(self, state):
        if np.random.rand() < self.EPSILON:
            action = np.random.randint(self.OUTPUT_SIZE)
        else:
            prediction = self.sess.run(self.actor.logits, feed_dict={self.actor.X:[state]})[0]
            action = np.argmax(prediction)
        return action

    def _construct_memories_and_train(self, replay):
        states = np.array([a[0] for a in replay])
        new_states = np.array([a[3] for a in replay])
        Q = self.sess.run(self.actor.logits, feed_dict={self.actor.X: states})
        Q_target = self.sess.run(self.actor_target.logits, feed_dict={self.actor_target.X: states})
        grads = self.sess.run(self.grad_critic, feed_dict={self.critic.X:states, self.critic.Y:Q})[0]
        self.sess.run(self.optimizer, feed_dict={self.actor.X:states, self.actor_critic_grad:grads})

        rewards = np.array([a[2] for a in replay]).reshape((-1, 1))
        rewards_target = self.sess.run(self.critic_target.logits,
                                       feed_dict={self.critic_target.X:new_states,self.critic_target.Y:Q_target})
        for i in range(len(replay)):
            if not replay[0][-1]:
                rewards[i] += self.GAMMA * rewards_target[i]
        cost, _ = self.sess.run([self.critic.cost, self.critic.optimizer],
                                feed_dict={self.critic.X:states, self.critic.Y:Q, self.critic.REWARD:rewards})
        return cost

    def get_state(self, t):
        window_size = self.window_size + 1
        d = t - window_size + 1
        block = self.trend[d : t + 1] if d >= 0 else -d * [self.trend[0]] + self.trend[0 : t + 1]
        res = []
        for i in range(window_size - 1):
            res.append(block[i + 1] - block[i])
        return np.array(res)

    def buy(self, initial_money):
        starting_money = initial_money
        states_sell = []
        states_buy = []
        inventory = []
        state = self.get_state(0)
        for t in range(0, len(self.trend) - 1, self.skip):
            action = self._select_action(state)
            next_state = self.get_state(t + 1)

            if action == 1 and initial_money >= self.trend[t]:
                inventory.append(self.trend[t])
                initial_money -= self.trend[t]
                states_buy.append(t)
                print('day %d: buy 1 unit at price %f, total balance %f'% (t, self.trend[t], initial_money))

            elif action == 2 and len(inventory):
                bought_price = inventory.pop(0)
                initial_money += self.trend[t]
                states_sell.append(t)
                try:
                    invest = ((close[t] - bought_price) / bought_price) * 100
                except:
                    invest = 0
                print(
                    'day %d, sell 1 unit at price %f, investment %f %%, total balance %f,'
#                     % (t, close[t], invest, initial_money)
                )

            state = next_state
        invest = ((initial_money - starting_money) / starting_money) * 100
        total_gains = initial_money - starting_money
        return states_buy, states_sell, total_gains, invest

    def train(self, iterations, checkpoint, initial_money):
        for i in range(iterations):
            total_profit = 0
            inventory = []
            state = self.get_state(0)
            starting_money = initial_money
            for t in range(0, len(self.trend) - 1, self.skip):
                if (self.T_COPY + 1) % self.COPY == 0:
                    self._assign('actor-original', 'actor-target')
                    self._assign('critic-original', 'critic-target')

                action = self._select_action(state)
                next_state = self.get_state(t + 1)

                if action == 1 and starting_money >= self.trend[t]:
                    inventory.append(self.trend[t])
                    starting_money -= self.trend[t]

                elif action == 2 and len(inventory) > 0:
                    bought_price = inventory.pop(0)
                    total_profit += self.trend[t] - bought_price
                    starting_money += self.trend[t]

                invest = ((starting_money - initial_money) / initial_money)

                self._memorize(state, action, invest, next_state, starting_money < initial_money)
                state = next_state
                batch_size = min(len(self.MEMORIES), self.BATCH_SIZE)
                replay = random.sample(self.MEMORIES, batch_size)
                cost = self._construct_memories_and_train(replay)
                self.T_COPY += 1
                self.EPSILON = self.MIN_EPSILON + (1.0 - self.MIN_EPSILON) * np.exp(-self.DECAY_RATE * i)
            if (i+1) % checkpoint == 0:
                print('epoch: %d, total rewards: %f.3, cost: %f, total money: %f'%(i + 1, total_profit, cost,
                                                                                  starting_money))

"""# 4. Train the Agnet"""

close = df.Close.values.tolist()
initial_money = 10000
window_size = 30
skip = 1
batch_size = 32
agent = Agent(state_size = window_size,
              window_size = window_size,
              trend = close,
              skip = skip)
agent.train(iterations = 400, checkpoint = 10, initial_money = initial_money)

"""# 5. Test the Agent"""

states_buy, states_sell, total_gains, invest = agent.buy(initial_money = initial_money)

"""# 6. Polt the Signals"""

fig = plt.figure(figsize = (15,5))
plt.plot(close, color='r', lw=2.)
plt.plot(close, '^', markersize=10, color='m', label = 'buying signal', markevery = states_buy)
plt.plot(close, 'v', markersize=10, color='k', label = 'selling signal', markevery = states_sell)
plt.title('actor-critic \n total gains %f, total investment %f%%'%(total_gains, invest))
plt.legend()
plt.show()



